import { Navigate, Outlet } from "react-router-dom";
import { useAuth } from "../../pages/TokenContext";

export default function ProtectedRoutes() {
  const { token } = useAuth();

  if (token) {
    return <Outlet />;
  } else {
    return <Navigate to="/" />;
  }

}
